import React, {useEffect, useState} from 'react'; 
import axios from 'axios';
import Key from './Key';


//Import Components
import Current from './components/Current';

function App() {
  let [zipCode, setZipCode] = useState(84020);
  let [location, setLocation] = useState();
  let [current, setCurrent] = useState();

  useEffect(() => {
    axios.get(`http://api.weatherapi.com/v1/current.json?key=${Key}&q=${zipCode}`)
   .then(response => {
     // handle success
     setLocation(response.data.location);
     setCurrent(response.data.current);
   })
   .catch(error => {
     // handle error
     console.log("Error fetching and parsing data", error);
   });
   },[]);


   let temp = current.temp_f;
   let uv = current.uv;
   let precip = current.precip_in;
   let humidity = current.humity;
   let icon = current.condition.icon;
   let city = location.name;  


  return (
    <div>
      <Current temp={temp} uv={uv} precip={precip} humidity={humidity} icon={icon} city={city} />
    </div>
  );
}

export default App;
